import React, {Component} from 'react';

class FrontPage extends Component {
  render(){
    return (
        <div>
        <div id="bg">


          <img src={require('./imgs/star_background.jpg')}/>
        </div>
        <span style={{backgroundColor: "rgb(0,0,0,0)"}}>Title</span>
        </div>
     );
  }

}

export default FrontPage;
